// Dashboard.js
import React, { useEffect } from 'react';

const Dashboard = ({ fetchUsers, fetchPosts, users, wpisy }) => {
  useEffect(() => {
    fetchUsers();
    fetchPosts();
  }, [fetchUsers, fetchPosts]);

  return (
    <div>
      <h1>Dashboard</h1>
      <table>
        <thead>
          <tr>
            <th>Name</th>
            <th>Tresc</th>
          </tr>
        </thead>
        <tbody>
          {users.map((user) => (
            <tr key={user.id}>
              <td>{user.name}</td>
              <td>
                {wpisy
                  .filter((wpis) => wpis.user_id === user.id)
                  .map((wpis) => wpis.tresc)
                  .join(', ')}
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default Dashboard;
